import React from "react";
import { NavLink } from "react-router-dom";
function AccountNavigate({ Link }) {

   return (
      <NavLink class="cab__list-item line-bottom">
         <div class="cab__list-icon">
            <img src="/img/page-icon/resume.png" alt="info" />
         </div>
         <p className="cab__list-link">Моя Информация</p>
      </NavLink>
   )
}
export default AccountNavigate
